Block vehicleTestingSystem {
    Feature massCompliance {
        Value massLimit = 2500.0 kg;
    }

    Block vehicle {
        Feature mass {
            Value actualMass;
        }
    }

    Block weighingEquipment {
        Block testOperator {
            Operation measureMass(vehicle: vehicle);
        }
    }

    Block testResult {
        Feature compliant {
            Value value = false;
        }
    }

    Block testSequence {
        Operation testVehicle(vehicle: vehicle): testResult {
            Sequence {
                Call testOperator->measureMass(vehicle);
                If (vehicle.mass.actualMass > massLimit) {
                    testResult->compliant = false;
                } else {
                    testResult->compliant = true;
                }
            }
        }
    }
}

